import Author from './author';

export const name = 'yx-node';
export const displayName = 'YX-Node';
const keywords = [
  'node',
  'tool',
  '@daybyday',
  'kit',
  'yx',
];

export default {
  name,
  displayName,
  github: {
    repo: `${Author.github.home}/${name}`,
  },
  npm: {
    url: `https://www.npmjs.com/package/@daybyday/${name}`,
  },
  header: {
    title: `${displayName} `,
    description: `${displayName}: Node toolkit`,
    keywords: [...keywords].join(', '),
    themeColor: '#1890FF',
    bgColor: '#ffffff',
    gaTrackingId: null,
  },
};
